import React from 'react';

const Timeline: React.FC = () => {
    const educationTimeline = [
        {
            year: '2020',
            degree: 'Bachelor of Science in Computer Science',
            institution: 'University A',
            description: 'Graduated with honors, focusing on software development and data structures.'
        },
        {
            year: '2021',
            degree: 'Full Stack Development Bootcamp',
            institution: 'Bootcamp B',
            description: 'Intensive program covering front-end and back-end technologies.'
        },
        {
            year: '2022',
            degree: 'Master of Science in Software Engineering',
            institution: 'University C',
            description: 'Specialized in software architecture and project management.'
        }
    ];

    return (
        <div className="p-6">
            <h2 className="text-2xl font-bold mb-4">Education Timeline</h2>
            <ul className="space-y-4">
                {educationTimeline.map((item, index) => (
                    <li key={index} className="border-l-4 border-blue-500 pl-4">
                        <h3 className="text-xl font-semibold">{item.year}</h3>
                        <p className="text-lg">{item.degree}</p>
                        <p className="text-gray-600">{item.institution}</p>
                        <p className="text-gray-500">{item.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Timeline;
